import React from 'react';
import { reverse } from 'named-urls';
import { FOOTPRINTS_ROUTES } from '../config';

const showUserDetails = (userId, props) => {
  const url = reverse(FOOTPRINTS_ROUTES.USERS.DETAIL.SHOW, { userId });
  props.history.push(url);
  return true;
};

const getUserCard = data => {
  const userCard = Object.values(data).map(userData => {
    const userId = userData.id;
    const title =
      userData.first_name && userData.last_name
        ? `${userData.first_name} ${userData.last_name}`
        : 'User';
    const body = (
      <div className="card-data-body user-email">Email: {userData.email}</div>
    );
    return { title, body, userId };
  });

  return userCard;
};

const getOrgUnits = data => {
  const orgCard = Object.values(data).map(orgData => {
    const userId = orgData.id;
    const title = orgData.name;
    const disable = !orgData.has_children;
    const body = <div>testing</div>;
    return { title, body, userId, disable };
  });
  return orgCard;
};

const getOrgUnitsNext = (orgUnitId, props) => {
  const url = reverse(FOOTPRINTS_ROUTES.ORG_UNITS.DETAIL.SHOW, { orgUnitId });
  props.history.push(url);
  return true;
};

const getOrgUnitsDetails = data => {
  const orgCard = Object.values(data).map(orgData => {
    const userId = orgData.id;
    const title = orgData.name;
    const disable = !orgData.has_children;
    const body = <div>some</div>;
    return { title, body, userId, disable };
  });
  return orgCard;
};

const dummy = () => {};
export {
  getUserCard,
  showUserDetails,
  getOrgUnits,
  getOrgUnitsNext,
  getOrgUnitsDetails,
  dummy
};
